import React from 'react';
import styled from 'styled-components';

const Spinner = (props) => {
    return (
        <Container>
            <div>LOADING</div>
        </Container>
    );
};
export default Spinner

const Container = styled.div`
width:100%;
height:100vh;
position:fixed;
top:0;
left:0;
background-color:skyblue;
    div{
        font-size:30px;
        font-weight:bold;
        position:absolute;
        top:50%;
        left:50%;
        transform:translate(-50%);
    }
`;
